import "./index.css"; // Ensure this file imports Tailwind directives

import { Header } from "./Header";
import { About } from "./About";
import { Services } from "./Services";

export const App = () => {
  return (
    <div>
      <Header />

      <main className="p-6">
        {/* Home Section */}
        <section id="home" className="h-screen flex items-center justify-center bg-gray-100">
          <h1 className="text-3xl font-bold">Welcome to My Website</h1>
        </section>
        <About/>

      {/* Services Section */}
        <Services/>

        {/* Contact Section */}
        <section id="contact" className="h-screen flex items-center justify-center bg-red-100">
          <h2 className="text-2xl font-bold">Contact Us</h2>
        </section>
      </main>
    </div>
  );
};
